import './ExpensesItem.css';

function ExpensesItem() {
  return (
    <div className="expense-item">
      <div>6th Jan, 2023</div>
      <div className="expense-item__description"><h2>Car</h2></div> 
      <div className="expense-item__price">$4555</div>
    </div>
  );
}
export default ExpensesItem;
